demo.repl.help:
Dostupné príkazy:
  @show              ─ zobraziť posledné zhrnutie adaptívnej karty
  @json              ─ vypísať surovú hodnotu JSON prijatú z flow
  @back              ─ vrátiť sa na predchádzajúcu blokovanú kartu/vstupy
  @input <k>=<v>     ─ nastaviť alebo prepísať vstupné pole
  @click <action_id> ─ odoslať kartu so zadanou akciou
  @help              ─ vypísať tento pomocný text
  @quit              ─ ukončiť REPL
